import Vue from 'vue'
import Router from 'vue-router'
import store from '../store';
import httpclient from '@/utils/httpclient'

// views
const Login = () => import(/* webpackChunkName:'login'*/'@/views/login/index');
const Register = () => import(/* webpackChunkName:'register'*/'@/views/register/index');
const RegisterSucc = () => import(/* webpackChunkName:'register-succ'*/'@/views/registerSucc/index');
const RegisterAccSucc = () => import(/* webpackChunkName:'register-acc-succ'*/'@/views/registerAccSucc/index');
const RegisterAccFail = () => import(/* webpackChunkName:'register-acc-fail'*/'@/views/registerAccFail/index');
const RegisterCheckFail = () => import(/* webpackChunkName:'register-check-fail'*/'@/views/registerCheckFail/index');
const RegisterCheckSucc = () => import(/* webpackChunkName:'register-check-succ'*/'@/views/registerCheckSucc/index');
const EmailVer = () => import(/* webpackChunkName:'email-ver'*/'@/views/emailVer/index');
const Dashboard = () => import(/* webpackChunkName:'dashboard'*/'@/views/dashboard/index');
const ResetPassword = () => import(/* webpackChunkName:'reset-password'*/'@/views/resetPassword/index');
const ForgetPassword = () => import(/* webpackChunkName:'forget-password'*/'@/views/forgetPassword/index');

// dashboard => chidren
const DashboardM = () => import(/* webpackChunkName:'dashboard-main'*/'@/views/dashboard/dashboardMain/mainI');
const DashboardV = () => import(/* webpackChunkName:'vehicle'*/'@/views/dashboard/dashboardMain/vehicle');
const DashboardVD = () => import(/* webpackChunkName:'vehicle-detail'*/'@/views/dashboard/dashboardMain/vehicleDetail');
const DashboardVE = () => import(/* webpackChunkName:'vehicle-edit'*/'@/views/dashboard/dashboardMain/vehicleEdit');
const Alerts = () => import(/* webpackChunkName:'alerts'*/'@/views/dashboard/dashboardMain/alerts');
const Profile = () => import(/* webpackChunkName:'profile'*/'@/views/dashboard/dashboardMain/profile');
const ChangePassword = () => import(/* webpackChunkName:'change-password'*/'@/views/dashboard/dashboardMain/changePassword');
const AddVehicle = () => import(/* webpackChunkName:'add-vehicle'*/'@/views/dashboard/dashboardMain/addVehicle');
const BindVehicle = () => import(/* webpackChunkName:'bind-vehicle'*/'@/views/dashboard/dashboardMain/bindVehicle');
const AlertDetail = () => import(/* webpackChunkName:'alert-detail'*/'@/views/dashboard/dashboardMain/alertDetail');
const Device = () => import(/* webpackChunkName:'device'*/'@/views/dashboard/dashboardMain/device');
const Admin = () => import(/* webpackChunkName:'admin'*/'@/views/dashboard/dashboardMain/admin');
const AdminEdit = () => import(/* webpackChunkName:'admin-edit'*/'@/views/dashboard/dashboardMain/adminEdit');
const AdminDetail = () => import(/* webpackChunkName:'admin-detail'*/'@/views/dashboard/dashboardMain/adminDetail');
const AdminInvite = () => import(/* webpackChunkName:'admin-invite'*/'@/views/dashboard/dashboardMain/adminInvite');
const Lots = () => import(/* webpackChunkName:'lots'*/'@/views/dashboard/dashboardMain/lots');
const LotsEdit = () => import(/* webpackChunkName:'lots-edit'*/'@/views/dashboard/dashboardMain/lotsEdit');
const addLots = () => import(/* webpackChunkName:'add-lots'*/'@/views/dashboard/dashboardMain/addLots');
const UserInviteRegister = () => import(/* webpackChunkName:'invite-register'*/'@/views/dashboard/dashboardMain/userInviteRegist');


Vue.use(Router);

const router =  new Router ({
	mode: 'history',
	linkActiveClass: 'open active',
	scrollBehavior: () => ({y:0}),
	routes: [
		{
			path: '/',
			redirect: '/index',
			name: 'Home',
			component: Dashboard,
			children: [
				{
					path: "index",
					component: DashboardM,
					name: 'Dashboard'
				},
				{
					path: "vehicle",
					component: {
						render (c) { return c('router-view') }
					},
					children: [
						{
							path: "",
							component: DashboardV,
							name: 'vehicle'
						},
						{
							path: "detail/:id",
							component: DashboardVD,
							name: 'Detail'
						},
						{
							path: "edit/:id",
							component: DashboardVE,
							name: 'VehicleEdit'
						},
						{
							path: "add",
							component: AddVehicle,
							name: 'AddVehicle'
						},
						{
							path: "bind",
							component: BindVehicle,
							name: 'BindVehicle'
						}
					]
				},
				{
					path: "alerts",
					component: {
						render (c) { return c('router-view') }
					},
					children: [
						{
							path: '',
							component: Alerts,
							name: "Alerts"
						},
						{
							path: 'detail/:id',
							component: AlertDetail,
							name: "AlertDetail"
						}
					],
				},
				{
					path: "/profile",
					component: Profile,
					name: "Profile"
				},
				{
					path: "/change-password",
					component: ChangePassword,
					name: "changePassword"
				},
				{
					path: "/device",
					component: Device,
					name: "device"
				},
				{
					path: "admin",
					component: {
						render (c) { return c('router-view') }
					},
					children:[
						{
							path: "",
							component: Admin,
							name: "admin",
						},
						{
							path:'detail/:id',
							component:AdminDetail,
							name:'adminDetail'
						},
						{
							path:'edit/:id',
							component:AdminEdit,
							name:'adminEdit'
						},
						{
							path:'invite',
							component:AdminInvite,
							name:'adminInvite'
						}
					]
				},
				{
					path: "lots",
					component: {
						render (c) {return c('router-view')}
					},
					children: [
						{
							path: "",
							component: Lots,
							name: "lots"
						},
						{
							path: "edit/:id",
							component: LotsEdit,
							name: "Edit"
						},
						{
							path: "add",
							component: addLots,
							name: "addLots"
						}
					]
				}
			]
		},
		{
			path: '/login',
			name: 'Login',
			component: Login
		},
		{
			path: '/userInviteRegister',
			name: 'userInviteRegister',
			component: UserInviteRegister
		},
		{
			path: '/register',
			name: 'Register',
			component: Register
		},
		{
			path: '/register-success',
			name: 'RegisterSuccess',
			component: RegisterSucc
		},
		{
			path: '/register-access-success',
			name: 'RegisterAccessSuccess',
			component: RegisterAccSucc
		},
		{
			path: '/register-access-fail',
			name: 'RegisterAccessFail',
			component: RegisterAccFail
		},
		{
			path: '/register-check-fail',
			name: 'RegisterCheckFail',
			component: RegisterCheckFail
		},
		{
			path: '/register-check-success',
			name: 'RegisterCheckSuccess',
			component: RegisterCheckSucc
		},
		{
			path: '/email-verification',
			name: 'EmailVerification',
			component: EmailVer
		},
		{
			path: '/reset-password',
			name: 'ResetPassword',
			component: ResetPassword,
		},
		{
			path: '/forget-password',
			name: 'ForgetPassword',
			component: ForgetPassword
		},
		{
			path: '*',
			redirect: '/index'
		}
	]
});

router.beforeEach((to, from, next) => {
	if (to.name == "Login" || to.name == "ForgetPassword") {
		next();
	} else {
		if (localStorage.getItem("user_info")) {
			store.dispatch("user_info", JSON.parse(localStorage.getItem("user_info")));
		}
		httpclient.get("/api/v1/checklogin", {}).then(() => {
			next();
		}).catch(() => {
			next('/login');
		});
	}
});


export default router
